import React from "react";

export default function Navibar() {
  return (
    <nav className="bg-[#8C9EFF] text-white p-4 shadow-md flex justify-between items-center">
      <h1 className="text-xl font-bold">SmartMeet AI</h1>
      <div className="space-x-4">
        <a href="#features" className="hover:underline">Features</a>
        <a href="#contact" className="hover:underline">Contact</a>
        <button className="bg-white text-[#8C9EFF] px-4 py-2 rounded font-semibold">
          Log In
        </button>
      </div>
    </nav>
  );
}
